import Navbar from "../../components/navbar/navbar.component";
import HeaderBanner from "../../components/header-banners/header-banners.component";
import CallToAction from "../../components/call-to-action/call-to-action.component";
import Footer from "../../components/footer/footer.component";

const JobSearchPage = () => {
    return (
        <div>
            <Navbar/>
            <HeaderBanner heading="Job Search"/>
            <div>
                <p>
                    Intercom works to maintain strong relationships with professionals in sales and digital marketing, for internal opportunities with Intercom, and to support external client needs and requirements. We strive to obtain the latest information on available temporary jobs, temp-to-hire and full-time employment opportunities in sales and digital marketing. Check back often to see if the our staffing agency has a listing that suits your skill set and career objectives. Otherwise, submit your resume to us and we will call you when a role in your area of interest arises.
                </p>
            </div>
            <CallToAction/>
            <Footer/>
        </div>
    )
}

export default JobSearchPage;
